import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import LandingPage from "./LandingPage";
import NoteItCanvas from "./NoteItCanvas";
import HospitalSelection from "./HospitalSelection";
import DoctorSelection from "./DoctorSelection";
import Footer from "./Footer";  // Make sure Footer.js exists
import AboutUs from "./AboutUs";  // Make sure AboutUs.js exists
import PrivacyPolicy from "./PrivacyPolicy";  // Make sure PrivacyPolicy.js exists
import ContactUs from "./ContactUs";  // Make sure ContactUs.js exists

function App() {
  return (
    <Router>
      <div style={{ minHeight: "100vh", display: "flex", flexDirection: "column" }}>
        <div style={{ flex: 1 }}>
          <Routes>
            {/* Existing Routes */}
            <Route path="/" element={<LandingPage />} />
            <Route path="/hospitals" element={<HospitalSelection />} />
            <Route path="/doctors/:hospitalId" element={<DoctorSelection />} />
            <Route path="/canvas/:doctorId" element={<NoteItCanvas />} />

            {/* New Footer Page Routes */}
            <Route path="/about-us" element={<AboutUs />} />
            <Route path="/privacy-policy" element={<PrivacyPolicy />} />
            <Route path="/contact-us" element={<ContactUs />} />
          </Routes>
        </div>

        {/* Footer */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
